import React from 'react';
import Image from './Image';

const Number = (props) => {
    return(
        <>
            <Image
                count = {props.count}
                isSmile = {props.isSmile}
            />
            <h2>{props.count}</h2>
            <br/>
            <div className="boxInner">
                <div className="btn" onClick = {()=>{props.add();props.toggle()}}>タップしてカウントだ！</div>
            </div>
        </>
    )
};
export default Number;
